DROP TABLE IF EXISTS `ya_content`;
CREATE TABLE `ya_content`  (
  `content_id` int(11) NOT NULL AUTO_INCREMENT COMMENT '内容id',
  `cover_id` int(11) NULL DEFAULT 0 COMMENT '封面id，mock(@natural(1, 10))',
  `name` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '名称，mock(@ctitle(5, 15))',
  `unique` varchar(127) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT '' COMMENT '标识（唯一），mock(@word(5, 10))',
  `title` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT '' COMMENT '标题',
  `author` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT '' COMMENT '作者（来源）',
  `url` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT '' COMMENT '链接',
  `keywords` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT '' COMMENT '关键词',
  `description` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT '' COMMENT '描述',
  `content` mediumtext CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL COMMENT '内容',
  `hits` int(11) NULL DEFAULT 0 COMMENT '点击量',
  `sort` int(11) NULL DEFAULT 250 COMMENT '排序',
  `is_top` tinyint(1) NOT NULL DEFAULT 0 COMMENT '是否置顶，1是0否',
  `is_hot` tinyint(1) NOT NULL DEFAULT 0 COMMENT '是否热门，1是0否',
  `is_rec` tinyint(1) NOT NULL DEFAULT 0 COMMENT '是否推荐，1是0否',
  `is_disable` tinyint(1) NOT NULL DEFAULT 0 COMMENT '是否禁用，1是0否',
  `is_delete` tinyint(1) NULL DEFAULT 0 COMMENT '是否删除，1是0否',
  `create_uid` int(11) NULL DEFAULT 0 COMMENT '添加用户id',
  `update_uid` int(11) NULL DEFAULT 0 COMMENT '修改用户id',
  `delete_uid` int(11) NULL DEFAULT 0 COMMENT '删除用户id',
  `create_time` datetime NULL DEFAULT NULL COMMENT '添加时间',
  `update_time` datetime NULL DEFAULT NULL COMMENT '修改时间',
  `delete_time` datetime NULL DEFAULT NULL COMMENT '删除时间',
  PRIMARY KEY (`content_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '内容管理' ROW_FORMAT = Compact;

